import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

function Homepage(){
  return (
    <h1> Hello Homepage </h1>
  );
}
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Homepage />}>
      </Route>
    </Routes>
  </BrowserRouter>
  );
}

export default App;
